import React,{useState} from 'react'
import ChatBubbleIcon from '@material-ui/icons/ChatBubble';



export default function ChatBot() {
    
    const[init,upda] = useState("none");

    const clicky=()=>{
       upda("block");
       alert()
    }

    return (
        <div>


            <div style={{width:"400px", height:"400px",backgroundColor:"rgb(205, 186, 109)",position:"fixed",left:"20px",bottom:"65px",cursor:"pointer",zIndex:"999999",borderRadius:"10px",display:init}}>

            </div>


          <ChatBubbleIcon onClick={clickyi} style={{width:'5rem',height:"5rem",color:"rgb(205, 186, 109)",position:"fixed",left:"20px",bottom:"14px",cursor:"pointer"}}/>  
        </div>
    )
}
